<?php

declare(strict_types=1);

use Logan\Nanhai\Client;
use PHPUnit\Framework\TestCase;

class Test extends TestCase
{
    protected $domain    = 'http://test2.nanhai.globalgood.vip/';
    protected $appId     = 'gdzh63488888tBCD';
    protected $appSecret = 'Qos1GfhGYGqugI5Q7OWOkPZgA162DftI';
    protected $appToken  = "c0pzyEmNY056tRKT";

    public function testGetAppToken()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance->getAppToken()->getResponse();
        var_dump($res);
    }

    public function testGetProjectHash()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance->getProjectHash($this->appToken, '2b94-c63a-af67c7ae-9f72-4a01d11f1e21', null)->getResponse();
        var_dump($res);
    }

    public function testGetProjectWorkers()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance->getProjectWorkers($this->appToken, '2b94-c63a-af67c7ae-9f72-4a01d11f1e21', null)->getResponse();
        $arr1 = $res["returnData"]["data"];
        $arr2 = $res["returnData"]["userInfoList"];
        $arr2 = array_map(function ($val) {
            return array_keys($val)[0];
        }, $arr2);
        $a = array_diff($arr1, $arr2);
        $b = array_diff($arr2, $arr1);
        $res = array_merge($a, $b);
        var_dump($res);
    }

    public function testGetProjectWorkerInfo()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance->getProjectWorkerInfo($this->appToken, '2b94-c63a-af67c7ae-9f72-4a01d11f1e21', "40bc-4853-31e09848-b5fc-386781bf648c", null)->getResponse();

        var_dump($res);
    }

    public function testAddAttendance()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance
            ->addAttendance(
                $this->appToken,
                '2b94-c63a-af67c7ae-9f72-4a01d11f1e21',
                '40bc-4853-31e09848-b5fc-386781bf648c',
                '1_268fcc82fabb4353',
                'in',
                (string)time(),
                'data:image/jpg;base64,',
                null,
                null
            )
            ->getResponse();

        var_dump($res);
    }

    public function testAddDevice()
    {
        $instance = new Client($this->domain, $this->appId, $this->appSecret);
        $res = $instance
            ->addDevice(
                $this->appToken,
                '2b94-c63a-af67c7ae-9f72-4a01d11f1e21',
                'Test_001',
                'in',
                'd0c9-b04c-b6d4cdcd-df5a-72477173afc3'
            )
            ->getResponse();

        var_dump($res);
    }
}
